import React from 'react';

const Card = () => {
    return (
        <div className="card">
            <img className="card__image"/>
            <div className="card__panel">
                <h2 className="card__title">33 слова о дизайне</h2>
                <button><img/></button>
                <p className="card__length"></p>
            </div>

        </div>
    );
};

export default Card;
